import React from 'react';
import {Link} from 'react-router-dom';

export class Footer extends React.Component {
    render () {
        return (
            <div className="footer">
                <ul className="footer-list">
                    {/* <li className="footer-item"><a href="/">Footer Item 1</a></li> 
                    <li className="footer-item"><a href="/">Footer Item 2</a></li> 
                    <li className="footer-item"><a href="/">Footer Item 3</a></li> 
                    <li className="footer-item"><a href="/">Footer Item 4</a></li> 
                    <li className="footer-item"><a href="/">Contact</a></li>  */}

                    <li className="footer-item"><Link to="/">HOME</Link></li> 
                    <li className="footer-item"><Link to="/photoshop">PHOTOSHOP</Link></li> 
                    <li className="footer-item"><Link to="https://www.facebook.com/DanielJMusgrave">Facebook</Link></li> 
                    <li className="footer-item"><Link to="/gamedev">Twitter</Link></li> 
                    <li className="footer-item"><Link to="/contact">Contact</Link></li> 
                </ul>
            </div>
        );
    }
};
